// @mui material components
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import { Divider } from "@mui/material";
import Card from "@mui/material/Card";

// Material Kit 2 React components
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";

// Material Kit 2 React examples
import DefaultNavbar from "examples/Navbars/DefaultNavbar";
import DefaultFooter from "examples/Footers/DefaultFooter";

// Presentation page sections

import Information from "pages/Presentation/sections/Information";
import Download from "pages/Presentation/sections/Download";

// Presentation page components
import BuiltByDevelopers from "pages/Presentation/components/BuiltByDevelopers";

// Routes
import routes from "routes";
import footerRoutes from "footer.routes";


// Images
import bgImage from "assets/images/bg1.jpg";
import imagelogo from "assets/images/logos/gray-logos/logo1.png";
import Carrusel from "examples/Cards/Slider/Slider";

function Presentation() {

  const blueColor = 'f0f0f0'; // Color azul
  const visibleRoutes = routes.filter((route) => !route.hidden);

  return (
    <>
      <DefaultNavbar
        action={{
          type: "internal",
          route: "/contacto",
          label: "CONTACTANOS",
          color: "info",
        }}
        routes={visibleRoutes}
        sticky
      />
      <MKBox
        minHeight="25rem"
        opacity={0.8}
        width="100%"
        sx={{
          backgroundImage: `url(${bgImage})`,
          backgroundSize: "cover",
          backgroundPosition: "top",
          backgroundAttachment: "fixed", // Fondo estático
          display: "grid",
          placeItems: "center"
        }}
      >
        <Container>
          <Grid container item xs={11} lg={4} md={6} sm={10} borderRadius={12} justifyContent="center" mx="auto">

              <img src={imagelogo} alt="Servicio Médico Empresarial L.S." width="40%"  justifyContent="center"/>
          </Grid>{" "}
        </Container>{" "}
      </MKBox>{" "}
      <Card
        sx={{
          p: 2,
          mx: {
            xs: 1,
            lg: 3,
            md: 2,
          },
          mt: -12,
          mb: 4,
          backgroundColor: ({ palette: { white }, functions: { rgba } }) => rgba(white.main, 0.8),
          backdropFilter: "saturate(200%) blur(30px)",
          boxShadow: ({ boxShadows: { xxl } }) => xxl,
        }}
      >
        <Container>
          <MKBox xs={12} lg={12}>
            <Grid
              item
              xs={12}
              md={0}
              sx={{
                mb: 10,
                mt: 4,
              }}
            >
              <MKTypography
                variant="h1"
                color="info"
                sx={{
                  textAlign: "center",
                  mb: 3,
                }}
              >
                Servicio Médico Empresarial L.S.{" "}
              </MKTypography>{" "}
              <MKTypography
                variant="h5"
                color="dark"
                opacity={0.8}
                sx={{
                  textAlign: "center",
                }}
              >
                Servicios médicos especializados en soporte empresarial.{" "}
              </MKTypography>{" "}
            </Grid>{" "}
          </MKBox>{" "}
        </Container>
        <Carrusel />
        <Divider style={{ backgroundColor: blueColor, height: 5, marginTop: 100 }} />
        <Grid container>
          <Grid
            item
            xs={12}
            md={0}
            sx={{
              mt: 6,
              mb: -3
            }}
          >
            <MKTypography
              variant="h2"
              color="info"
              sx={{
                textAlign: "center",
                mb: 3,
              }}
            >
              ¡Estamos a tu servicio!{" "}
            </MKTypography>{" "}
            <MKTypography
              variant="body1"
              color="dark"
              opacity={0.8}
              sx={{
                textAlign: "center",
              }}
            >
              Con más de 10 años de experiencia, ¡Estamos listos para ayudarte!
            </MKTypography>{" "}
            <Information />
          </Grid>{" "}
        </Grid>{" "}
        <Divider style={{ backgroundColor: blueColor, height: 5, marginTop: 50, marginBottom: 100 }} />
        <BuiltByDevelopers />
        <Download />{" "}
      </Card>{" "}
      <MKBox pt={6} px={1} mt={6}>
        <DefaultFooter content={footerRoutes} />{" "}
      </MKBox>{" "}
    </>
  );
}

export default Presentation;
